    return (
        <div>
            <Number/>
            <Buttons/>
        </div>
    );
}


function Number(props) {
    return (
        <div className="number">0</div>
    );
}


function Buttons(props) {
    return (
        <div>
        <div className="btn_1"></div>
            <div className="btn_2"></div>
            <div className="btn_3"></div>
        </div>
    );
}





export default MainContent;
